import Product from "./Product";

import styles from "./Shop.module.css";

const Shop = (props) => {
    const { products } = props;
    return (
        <section>
            <div className={styles.items}>
                {products.map((product) => (
                    <Product product={product} />
                ))}
            </div>
        </section>
    );
};

export default Shop;
